import React, { Component } from 'react';

const text = {
  name: 'Carula Garat',
  title: 'UX/UI Designer',
};

const myDiv = <div>something something</div>;

class App extends Component {
  render() {
    return (
      <div className="mainlayout">
        <h1>{text.name}</h1>
        <h2>{text.title}</h2>
        {myDiv}
      </div>
    );
  }
}

export default App;
